    componentDidMount = () => {
    };


    render() {
        var floorDetails = [];
        for (var i = this.state.floors - 1; i >= 0; i--) {
            var floor = i;
            if(i == 0){
                floor = "Ground Floor";
            }
            floorDetails.push(
                <div className={`floorSection floorBlock_${i}`}>
                    <div className="floorNum">{i}</div>
                    <Elevators  />
                    <div className="elevatorCall" onClick={() => this.callElevator(i)}>{this.state.elevatorStatus}</div>
                </div>
            );
        }

        return (
            <div className="floorsWrapper">
                {floorDetails}
            </div>
        );
    }
}

export default Floors;
